import config from "../config"
import Home from "../pages/Home"
import Login from "../pages/Login";
import Test from "../pages/Test/test";
import DefaultLayout from "../components/Layouts/DefaultLayout";
import { useState } from "react";


const [toggleFunctionLoginLogout, settoggleFunctionLoginLogout] = useState();

const publicRoutes = [
    {path: config.routes.home, component: Home, layout: DefaultLayout, props: settoggleFunctionLoginLogout},
    {path: config.routes.nam, component: Home, layout: DefaultLayout},
    {path: config.routes.login, component: Login, layout: null, props: toggleFunctionLoginLogout},  
    {path: config.routes.test, component: Test, layout: null},
];

const privateRoutes = [];

export {publicRoutes, privateRoutes};
